function addArenaEnemy(level, speed, attack, defense, accuracy, evasion, hp, exp, coin, pixel, name, element, boss, evolve, heal, zombie, rangeDamage, explode, explodeDamage, rampagePct, skill, skillLevel, art, loc, allyPassive1, allyPassive1X, allyPassive2, allyPassive2X, allyPassive3, allyPassive3X, allyActive1, allyActive1X, allyActive1Y, allyActive1Z, allyActive2, allyActive2X, allyActive2Y, allyActive2Z, allyActive3, allyActive3X, allyActive3Y, allyActive3Z)
{
 var temp = new enemy (level, speed, attack, defense, accuracy, evasion, hp, exp, coin, pixel, name, element, boss, evolve, heal, zombie, rangeDamage, explode, explodeDamage, rampagePct, skill, skillLevel, art, loc, allyPassive1, allyPassive1X, allyPassive2, allyPassive2X, allyPassive3, allyPassive3X, allyActive1, allyActive1X, allyActive1Y, allyActive1Z, allyActive2, allyActive2X, allyActive2Y, allyActive2Z, allyActive3, allyActive3X, allyActive3Y, allyActive3Z)
   enemyList.push(temp);
}

function enemy (level, speed, attack, defense, accuracy, evasion, hp, exp, coin, pixel, name, element, boss, evolve, heal, zombie, rangeDamage, explode, explodeDamage, rampagePct, skill, skillLevel, art, loc, allyPassive1, allyPassive1X, allyPassive2, allyPassive2X, allyPassive3, allyPassive3X, allyActive1, allyActive1X, allyActive1Y, allyActive1Z, allyActive2, allyActive2X, allyActive2Y, allyActive2Z, allyActive3, allyActive3X, allyActive3Y, allyActive3Z){
   this.level = level;
   this.speed = speed;
   this.attack = attack;
   this.defense = defense;
   this.accuracy = accuracy;
   this.evasion = evasion;
   this.hp = hp;
   this.exp = exp;
   this.coin = coin;
   this.pixel = pixel;
   this.name = name;
   this.element = element;
   this.boss = boss;
   this.evolve = evolve;
   this.heal = heal;
   this.zombie = zombie;
   this.rangeDamage = rangeDamage;
   this.explode = explode;
   this.explodeDamage = explodeDamage;
   this.rampagePct = rampagePct;
   this.skill = skill;
   this.skillLevel = skillLevel;
   this.art = art;
   this.loc = loc;
   this.allyPassive1 = allyPassive1;
   this.allyPassive1X = allyPassive1X;
   this.allyPassive2 = allyPassive2;
   this.allyPassive2X = allyPassive2X;
   this.allyPassive3 = allyPassive3;
   this.allyPassive3X = allyPassive3X;
   this.allyActive1 = allyActive1;
   this.allyActive1X = allyActive1X;
   this.allyActive1Y = allyActive1Y;
   this.allyActive1Z = allyActive1Z;
   this.allyActive2 = allyActive2;
   this.allyActive2X = allyActive2X;
   this.allyActive2Y = allyActive2Y;
   this.allyActive2Z = allyActive2Z;
   this.allyActive3 = allyActive3;
   this.allyActive3X = allyActive3X;
   this.allyActive3Y = allyActive3Y;
   this.allyActive3Z = allyActive3Z;
}
